INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_homeHeadline`, `field_mainHeading`, `field_subHeading`, `field_body`, `field_leftHeading1`, `field_leftContent1`, `field_leftHeading2`, `field_leftContent2`, `field_leftContent3`, `field_leftHeading3`, `field_phoneNumber`, `field_email`, `field_address`, `field_mapLocation`, `field_primaryColor`, `field_topSummary`, `field_bodyHeader`, `field_projectHeading1`, `field_projectHeading2`, `field_projectHeading3`, `field_projectHeading4`, `field_projectHeading5`, `field_projectHeading6`, `field_projectDesc1`, `field_projectDesc2`, `field_projectDesc3`, `field_projectDesc4`, `field_projectDesc5`, `field_projectDesc6`, `field_primaryColor1`, `field_primaryColor2`, `field_primaryColor3`, `field_primaryColor4`, `field_primaryColor5`, `field_primaryColor6`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '1', 'en', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-16 12:25:29', '2016-06-16 16:48:25', '578284d1-950e-4732-85f2-b38f7ceb9391'),
 ('2', '2', 'en', 'Portfolio - MG', 'I’m a digital product designer & student at brunel university. I make beautiful things that work.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cadenza', 'Ambio', 'Cosmos', 'Badnoise', 'Photography', 'Apply Ignorance', 'app design', 'product development', 'branding', 'web app build', 'my portfolio', 'website build', '#df006a', '#00c3f2', '#d5d5d5', '#76fbf6', '#000000', '#00b3ff', '2016-06-16 12:25:31', '2016-06-29 11:21:46', 'adac0ffa-420a-41db-9952-b7c7003fa6ec'),
 ('4', '4', 'en', 'About', NULL, 'About Me', 'I\'ve done many things - some of them uninteresting - most of them legendary.', '<p>This was completed as an assignment for my Design for Mobile module at university. The brief was very open – create an app for a smartphone. I have an iPhone so I decided to design for what I knew, and what I could test myself.</p>\n\n<p>The idea of the app is now something I am pursuing in the real world – I am starting to learn to code in Swift, and have acquired the social media accounts. I intend to develop the app, and market it myself over the coming year. What you see here was created and exported entirely from Sketch – then entered into InVision to create the working prototype at the bottom of the page.</p>\n\n\n\n\n\n\n\n\n\n<p>Put simply, the app helps musicians to acquire business, and people who need talented artists to find them. The app allows people to post jobs, and post pay details, or expenses. They also include the skills they require, and what level they need them to be. The musician has a profile which includes all of this information.</p>', 'Current Employer', '<p><a href=\"http://www.inktrap.co.uk\" target=\"_blank\">Inktrap</a></p>', 'Education', '2nd Year Digital Design BSc @ Brunel University', 'Sketch, Invision, UI, UX, Adobe Suite, HTML, CSS, jQuery, PHP SQL, Web Design, Photography', 'Skills', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-16 16:36:08', '2016-06-23 16:47:30', 'ec4ee2b9-0aeb-4556-9ec5-163388f7fdd4'),
 ('5', '5', 'en', 'Contact', NULL, 'Like what you see? Maybe we should talk.', 'I am currently working as a Digital Product Designer for a fabulous little agency called Inktrap so am not accepting new freelance clients. However - if you have something cool to talk about I\'m always interested...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '07778811215', 'me@matt-gibbs.com', 'Aldgate Tower <br>\r\nWhitechapel High Street<br>\r\nLondon <br>\r\nE1 7PU', '{lat: 51.5148623, lng: -0.07222109999997883}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-16 16:36:26', '2016-06-23 17:19:54', '0d6c6fc9-d3b0-4ca5-94d3-7c7637e196d8'),
 ('6', '9', 'en', 'Cadenza', NULL, 'Cadenza', 'An application and Invision protoype connecting musicians to their next gigs.', '<p>This was completed as an assignment for my Design for Mobile module at university. The brief was very open – create an app for a smartphone. I have an iPhone so I decided to design for what I knew, and what I could test myself.</p>\n\n<p>The idea of the app is now something I am pursuing in the real world – I am starting to learn to code in Swift, and have acquired the social media accounts. I intend to develop the app, and market it myself over the coming year. What you see here was created and exported entirely from Sketch – then entered into InVision to create the working prototype at the bottom of the page.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Put simply, the app helps musicians to acquire business, and people who need talented artists to find them. The app allows people to post jobs, and post pay details, or expenses. They also include the skills they require, and what level they need them to be. The musician has a profile which includes all of this information.</p><p><a href=\"https://invis.io/UY4UBYP32\" target=\"_blank\">To play with the prototype of the app, go here.</a></p>', 'Module', '<p>Mobile Application Design</p>', 'Grade Received', 'A', 'Sketch, Invision, UI, UX', 'Skills Required ', NULL, NULL, NULL, NULL, '#df006a', 'An application and Invision protoype connecting musicians to their next gigs.', 'A job listing application for musicians to find work, and employers to find temporary or long term musical partners.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-23 17:34:48', '2016-06-29 11:13:53', '8a84042d-b33f-4445-875e-09371925d9c3'),
 ('7', '10', 'en', 'UI Design', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-24 09:49:07', '2016-06-24 09:49:07', '41459c2c-0afb-4461-82a1-ff2d69517cf2'),
