 ('27', '30', 'en', 'Ambio', NULL, 'Ambio', 'Exploiting a emerging digital technology to create a new digital product.', '<p>Ambient Intelligence (sometimes referred to as ubiquitous computing) is a technology which does not, currently, exist anywhere it a perfect form. It is not, therefore, a single piece of hardware, or software. It does not come in a box marked ‘ambient intelligence’ with instructions to simply plug in and connect to wifi. It is more esoteric than that. It pertains to an integration between users and technology.<br /></p>\n\n<p>Ambio is a product which couples an implantable chip, consisting of\na uniquely identifiable RFID tag, and small, transmitting biosensors\nwhich monitor vital signs of a user. This chip is coupled with the\nambio app, which uses this data to make the user’s smarthome\nenvironment ambiently intelligent. </p>\n\n\n\n\n\n\n\n\n\n<p>The app communicates with the user’s house, car, and other appliances, including their online\naccounts proactively, reducing the need for a user constantly\ninteract with technology. The implantable RFID tag can also be used\nfor storing vital medical information, unlocking a house and car, and\ntracking and identifying a user within their smarthome. </p>', 'Module', '<p>EE2614 - Experimental Digital Futures</p>', 'Grade', 'A-', 'Detailed Research and Citation, Sketch, UI, UX, Branding', 'Skills Required', NULL, NULL, NULL, NULL, '#00c3f2', 'Exploiting a emerging digital technology to create a new digital product.', 'Selecting Ambient Intelligence as my emerging technology, I had to research the technology, then create a new digital product, design, brand, and justify it in theory.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-25 17:33:29', '2016-06-28 11:39:01', '13a8e55a-e2d2-44d2-8880-cd2c0c8e5e10'),
