 ('35', '38', 'en', 'Cosmos', NULL, 'Cosmos', 'Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.', '<p>Cosmos brand mission is to provide quality fuel with personality.\nWhether the fuel is electricity, hydrogen, or good old fashioned\npetrol, you’ll be part of the Cosmos experience.</p>\n\n<p>Cosmos is bringing the future of fuel delivery, both in what we\nprovide, and how we do it - we stretch what is possible. We value\nout of this world service above all else, and people are what make us\ngreat. We are the only fuel company to offer a personal fuel delivery\nservice, and to make you feel at home while we do it .</p>\n\n\n\n\n\n\n\n<p><strong>A Cosmos Experience</strong></p>\n\n\n\n\n\n\n\n<p>Bong. Low Fuel. You use handsfree to get Siri to find you the nearest Cosmos, she does this using the app on your phone, and sets the\nnavigiation accordingly. You pull onto the forecourt - currently all of the manned pumps are taken, with motorists in their car relaxing with a\nfree coffee whilst their fuel is pumped. You drive to the self service pump. As you drive up, the ANPR cameras recognise your car - ‘Welcome\nChristopher’ is displayed. </p>\n\n\n\n\n\n\n\n<p>As you always fill up with Petrol, this option is preselected in the one pump system, but you confirm the choice,\nand start to fill up. The meter ticks over onto £25, and you touch Finish and Pay. 3 options are displayed; Card, Cash, and Cosmos Pay. You\nchoose the latter, and the payment process is confirmed. The pump has communicated with your account with Cosmos to get the payment,\nand has credited you with the appropriate loyalty coupons. Next time you come you’ll get a free coffee and 5p o  per litre - Bonus. </p>\n\n\n\n\n\n\n\n<p>\nAs you get into your car and drive away, a push notification pops up on your phone “Thank you for refuelling with Cosmos, see you in the\nfuture...”. </p>', 'Module', '<p>Design Practice</p>', 'Grade Received ', 'B+', 'Branding, Sketch Design, InDesign Documentation, Presentation', 'Skills Required', NULL, NULL, NULL, NULL, '#d4d4d4', 'Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.', 'As part of my second year Design Practice module, ELSE set an industry brief to design and brand a new premium fuel retailer.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-26 12:34:51', '2016-06-28 11:45:32', '9d9a4f00-46f8-4a57-ad6c-d5659a98d12c'),
