 ('52', '55', 'en', 'Apply Ignorance', NULL, 'Apply Ignorance', 'Animated scrolling storytelling, based around an esoteric link.', '<p>This project was rather odd. Essentially we were given two random famous people from history, and asked to find a link between them. From this link, we would make an \'artefact\'. This artefact could be anything we could reasonably create ourselves, so long as it portrayed the link we had decided on. </p>\n\n<p>My two famous people were Miles Davis, the jazz trumpeter, and Robert Frank, an american photographer. Initially I found it hard to find links between these two men. They were both similar in minor aspects, but also vastly different in nearly every other aspects. Eventually after a lot of research, my links began to look suitably esoteric. I decided on three to present as part of the module, but had already envisioned the end goal, and the end link - titled <strong>Subjectivity of Creativity</strong>.</p>\n\n\n\n<p>The main idea from this was that creativity is, at its heart, extremely dependent on its context and surroundings. If Einstein had been born into Dark Ages England for example, he probably would have been burned at the stake for witchcraft. With this in mind, I decided to use Adobe Muse to create a set of scrollable webpages, which would tell stories through moving elements. The stories themselves would centre around 3 great progressives and creatives; Barack Obama, Steve Jobs, and Einstein.</p>\n\n\n\n<p><a href=\"http://brunel.ac.uk/~dt14mmg/ignorance/\" target=\"_blank\">You can view this project and explore for yourself here.</a></p>', 'Module', '<p>People Fusion</p>', 'Grade Achieved', 'A', 'Research, Illustration, Adobe Muse', 'Skills Required', NULL, NULL, NULL, NULL, '#00b3ff', 'Animated scrolling storytelling, based around an esoteric link.', 'Scrollable, dynamic storytelling, exploring the possibilities great creatives and visionaries would have had open to them had they been born in another time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-27 11:25:16', '2016-06-28 12:10:15', '7339ae31-c2b5-4856-9630-8a3a15e14c0e'),
