 ('63', '66', 'en', 'Photography', NULL, 'Photography', 'In my spare time I like to take photos - here are some.', '<p>This will be short and sweet - all of my photos are not hosted here because I am cheap and don\'t want to pay to host trillions of images, each of which is huge. </p>\n\n<p><a href=\"https://www.flickr.com/photos/126928783@N04/\" target=\"_blank\">You will find all of my best photographs here, at my flickr account - I hope you like them.</a></p>\n\n\n\n\n\n\n\n<p>Also, if you have any questions about any of them, or would like to see more; there is around 13,000 of them sitting in my Lightroom at the moment. Let me know. Below are three good\'uns.</p>', 'Personal Camera', '<p>Canon 5D Mk III</p>', 'Favourite Lens', '24-105mm L Zoom', 'Amsterdam', 'Favourite Place', NULL, NULL, NULL, NULL, '#000000', 'In my spare time I like to take photos - here are some.', 'Photos are cool to look at, so here are mine.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-06-27 12:17:13', '2016-06-28 12:17:31', '4a48a381-034b-49a1-8119-8b11cb9a4807'),
