 ('20', '4', '3', '1', 'en', '10', '', '{\"typeId\":\"3\",\"authorId\":null,\"title\":\"About\",\"slug\":\"about\",\"postDate\":1466696449,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This was completed as an assignment for my Design for Mobile module at university. The brief was very open \\u2013 create an app for a smartphone. I have an iPhone so I decided to design for what I knew, and what I could test myself.<\\/p><p>The idea of the app is now something I am pursuing in the real world \\u2013 I am starting to learn to code in Swift, and have acquired the social media accounts. I intend to develop the app, and market it myself over the coming year. What you see here was created and exported entirely from Sketch \\u2013 then entered into InVision to create the working prototype at the bottom of the page.<\\/p><p><span><\\/span>Put simply, the app helps musicians to acquire business, and people who need talented artists to find them. The app allows people to post jobs, and post pay details, or expenses. They also include the skills they require, and what level they need them to be. The musician has a profile which includes all of this information.<\\/p>\",\"15\":\"<a href=\\\"http:\\/\\/www.inktrap.co.uk\\\">Inktrap<\\/a>\",\"17\":\"2nd Year Digital Design BSc @ Brunel University\",\"18\":\"Sketch, Invision, UI, UX, Adobe Suite, HTML, CSS, jQuery, PHP SQL, Web Design, Photography\",\"14\":\"Current Employer\",\"16\":\"Education\",\"19\":\"Skills\",\"4\":\"About Me\",\"5\":\"I\'ve done many things - some of them uninteresting - most of them legendary.\"}}', '2016-06-23 16:39:06', '2016-06-23 16:39:06', 'd8e01938-15e4-4fa4-b546-a4be3acb01d4'),
