 ('45', '30', '5', '1', 'en', '3', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Ambio\",\"slug\":\"ambio\",\"postDate\":1466875980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This was completed as an assignment for my Design for Mobile module at university. The brief was very open \\u2013 create an app for a smartphone. I have an iPhone so I decided to design for what I knew, and what I could test myself.<\\/p>\\r\\n\\r\\n<p>The idea of the app is now something I am pursuing in the real world \\u2013 I am starting to learn to code in Swift, and have acquired the social media accounts. I intend to develop the app, and market it myself over the coming year. What you see here was created and exported entirely from Sketch \\u2013 then entered into InVision to create the working prototype at the bottom of the page.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>Put simply, the app helps musicians to acquire business, and people who need talented artists to find them. The app allows people to post jobs, and post pay details, or expenses. They also include the skills they require, and what level they need them to be. The musician has a profile which includes all of this information.<\\/p>\",\"29\":\"Exploiting a emerging digital technology to create a new digital product.\",\"30\":[\"29\"],\"15\":\"<p>EE2614 - Experimental Digital Futures<\\/p>\",\"17\":\"A-\",\"18\":\"Detailed Research and Citation, Sketch, UI, UX, Branding\",\"14\":\"Module\",\"16\":\"Grade\",\"19\":\"Skills Required\",\"4\":\"Ambio\",\"26\":\"#00c3f2\",\"27\":[\"23\"],\"31\":[\"31\"],\"32\":[\"32\"],\"33\":[\"33\"],\"25\":[\"12\",\"14\",\"15\"],\"5\":\"Exploiting a emerging digital technology to create a new digital product.\",\"28\":\"Exploiting a emerging digital technology to create a new digital product.\"}}', '2016-06-25 18:02:34', '2016-06-25 18:02:34', 'e96f15da-9d45-4f31-9380-2ba48142178e'),
 ('46', '9', '5', '1', 'en', '11', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Cadenza\",\"slug\":\"cadenza\",\"postDate\":1466703240,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This was completed as an assignment for my Design for Mobile module at university. The brief was very open \\u2013 create an app for a smartphone. I have an iPhone so I decided to design for what I knew, and what I could test myself.<\\/p>\\r\\n\\r\\n<p>The idea of the app is now something I am pursuing in the real world \\u2013 I am starting to learn to code in Swift, and have acquired the social media accounts. I intend to develop the app, and market it myself over the coming year. What you see here was created and exported entirely from Sketch \\u2013 then entered into InVision to create the working prototype at the bottom of the page.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Put simply, the app helps musicians to acquire business, and people who need talented artists to find them. The app allows people to post jobs, and post pay details, or expenses. They also include the skills they require, and what level they need them to be. The musician has a profile which includes all of this information.<\\/p>\",\"29\":\"A job listing application for musicians to find work, and employers to find temporary or long term musical partners.\",\"30\":[\"22\"],\"15\":\"<p>Mobile Application Design<\\/p>\",\"17\":\"A\",\"18\":\"Sketch, Invision, UI, UX\",\"14\":\"Module\",\"16\":\"Grade Received\",\"19\":\"Skills Required \",\"4\":\"Cadenza\",\"26\":\"#df006a\",\"27\":[\"17\"],\"31\":[\"19\"],\"32\":[\"20\"],\"33\":[\"21\"],\"25\":[\"12\",\"13\",\"14\"],\"5\":\"An application and Invision protoype connecting musicians to their next gigs.\",\"28\":\"An application and Invision protoype connecting musicians to their next gigs.\"}}', '2016-06-26 12:13:22', '2016-06-26 12:13:22', 'd62fd745-5fb8-4a27-be58-c639f250b7d8'),
 ('47', '30', '5', '1', 'en', '4', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Ambio\",\"slug\":\"ambio\",\"postDate\":1466875980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>Ambient Intelligence (sometimes referred to as ubiquitous computing) is a technology which does not, currently, exist anywhere it a perfect form.&nbsp;It is not, therefore, a single piece of hardware, or software. It does not come in a box marked \\u2018ambient intelligence\\u2019 with instructions to simply plug in and connect to wifi. It is more esoteric than that. It pertains to an integration between users and technology.<br><\\/p><p>Ambio is a product which couples an implantable chip, consisting of\\r\\na uniquely identifiable RFID tag, and small, transmitting biosensors\\r\\nwhich monitor vital signs of a user. This chip is coupled with the\\r\\nambio app, which uses this data to make the user\\u2019s smarthome\\r\\nenvironment ambiently intelligent.&nbsp;<\\/p><p>The app communicates with&nbsp;the user\\u2019s house, car, and other appliances, including their online\\r\\naccounts proactively, reducing the need for a user constantly\\r\\ninteract with technology. The implantable RFID tag can also be used\\r\\nfor storing vital medical information, unlocking a house and car, and\\r\\ntracking and identifying a user within their smarthome.&nbsp;<\\/p>\",\"29\":\"Selecting Ambient Intelligence as my emerging technology, I had to research the technology, then create a new digital product, design, brand, and justify it in theory.\",\"30\":[\"29\"],\"15\":\"<p>EE2614 - Experimental Digital Futures<\\/p>\",\"17\":\"A-\",\"18\":\"Detailed Research and Citation, Sketch, UI, UX, Branding\",\"14\":\"Module\",\"16\":\"Grade\",\"19\":\"Skills Required\",\"4\":\"Ambio\",\"26\":\"#00c3f2\",\"27\":[\"23\"],\"31\":[\"32\"],\"32\":[\"35\"],\"33\":[\"33\"],\"25\":[\"12\",\"15\",\"34\"],\"5\":\"Exploiting a emerging digital technology to create a new digital product.\",\"28\":\"Exploiting a emerging digital technology to create a new digital product.\"}}', '2016-06-26 12:23:13', '2016-06-26 12:23:13', '1fbecb1b-93c4-453c-90b4-acbf26b2599a'),
 ('48', '38', '5', '1', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Cosmos\",\"slug\":\"cosmos\",\"postDate\":null,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"13\":\"\",\"29\":\"\",\"30\":[\"37\"],\"15\":\"\",\"17\":\"\",\"18\":\"\",\"14\":\"\",\"16\":\"\",\"19\":\"\",\"4\":\"Cosmos\",\"26\":\"#d4d4d4\",\"27\":[\"24\"],\"31\":\"\",\"32\":\"\",\"33\":\"\",\"25\":[\"13\",\"15\",\"36\"],\"5\":\"Theoretical branding exercise for a new, premium fuel retailer.\",\"28\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\"}}', '2016-06-26 12:34:51', '2016-06-26 12:34:51', '266e8240-509b-403a-8ba3-4c92e3914bfa'),
 ('49', '38', '5', '1', 'en', '2', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Cosmos\",\"slug\":\"cosmos\",\"postDate\":null,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"13\":\"\",\"29\":\"\",\"30\":[\"37\"],\"15\":\"\",\"17\":\"\",\"18\":\"\",\"14\":\"\",\"16\":\"\",\"19\":\"\",\"4\":\"Cosmos\",\"26\":\"#d4d4d4\",\"27\":[\"24\"],\"31\":\"\",\"32\":\"\",\"33\":\"\",\"25\":[\"13\",\"15\",\"36\"],\"5\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\",\"28\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\"}}', '2016-06-26 12:35:00', '2016-06-26 12:35:00', '4c71e5be-eb56-4119-8e35-7fb87d70c68e'),
 ('50', '38', '5', '1', 'en', '3', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Cosmos\",\"slug\":\"cosmos\",\"postDate\":1466944500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>Cosmos brand mission is to provide quality fuel with personality.\\r\\nWhether the fuel is electricity, hydrogen, or good old fashioned\\r\\npetrol, you\\u2019ll be part of the Cosmos experience.<\\/p>\\r\\n\\r\\n<p>Cosmos is bringing the future of fuel delivery, both in what we\\r\\nprovide, and how we do it - we stretch what is possible. We value\\r\\nout of this world service above all else, and people are what make us\\r\\ngreat. We are the only fuel company to o er a personal fuel delivery\\r\\nservice, and to make you feel at home while we do it .<\\/p><p><strong>A&nbsp;Cosmos Experience<\\/strong><span><\\/span><\\/p><p>Bong. Low Fuel. You use handsfree to get Siri to find you the nearest Cosmos, she does this using the app on your phone, and sets the\\r\\nnavigiation accordingly. You pull onto the forecourt - currently all of the manned pumps are taken, with motorists in their car relaxing with a\\r\\nfree coffee whilst their fuel is pumped. You drive to the self service pump. As you drive up, the ANPR cameras recognise your car - \\u2018Welcome\\r\\nChristopher\\u2019 is displayed.&nbsp;<\\/p><p>As you always fill up with Petrol, this option is preselected in the one pump system, but you confirm the choice,\\r\\nand start to&nbsp;fill up. The meter ticks over onto \\u00a325, and you touch Finish and Pay. 3 options are displayed; Card, Cash, and Cosmos Pay. You\\r\\nchoose the latter, and the payment process is confirmed. The pump has communicated with your account with Cosmos to get the payment,\\r\\nand has credited you with the appropriate loyalty coupons. Next time you come you\\u2019ll get a free coffee and 5p o  per litre - Bonus.&nbsp;<\\/p><p>\\r\\nAs you get into your car and drive away, a push notification pops up on your phone \\u201cThank you for refuelling with Cosmos, see you in the\\r\\nfuture...\\u201d.&nbsp;<\\/p>\",\"29\":\"As part of my second year Design Practice module, ELSE set an industry brief to design and brand a new premium fuel retailer.\",\"30\":[\"37\"],\"15\":\"<p>Design Practice<\\/p>\",\"17\":\"B+\",\"18\":\"Branding, Sketch Design, InDesign Documentation, Presentation\",\"14\":\"Module\",\"16\":\"Grade Received \",\"19\":\"Skills Required\",\"4\":\"Cosmos\",\"26\":\"#d4d4d4\",\"27\":[\"24\"],\"31\":[\"39\"],\"32\":[\"40\"],\"33\":[\"41\"],\"25\":[\"13\",\"15\",\"36\"],\"5\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\",\"28\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\"}}', '2016-06-26 12:44:51', '2016-06-26 12:44:51', '8c48d4bb-55df-4c59-99c4-a6ad7051ce5c'),
