get into your car and drive away, a push notification pops up on your phone \\u201cThank you for refuelling with Cosmos, see you in the\\r\\nfuture...\\u201d.&nbsp;<\\/p>\",\"29\":\"As part of my second year Design Practice module, ELSE set an industry brief to design and brand a new premium fuel retailer.\",\"30\":[\"37\"],\"15\":\"<p>Design Practice<\\/p>\",\"17\":\"B+\",\"18\":\"Branding, Sketch Design, InDesign Documentation, Presentation\",\"14\":\"Module\",\"16\":\"Grade Received \",\"19\":\"Skills Required\",\"4\":\"Cosmos\",\"26\":\"#d4d4d4\",\"27\":[\"24\"],\"31\":[\"39\"],\"32\":[\"42\"],\"33\":[\"41\"],\"25\":[\"13\",\"15\",\"36\"],\"5\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\",\"28\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\"}}', '2016-06-26 12:51:36', '2016-06-26 12:51:36', '033fc229-7263-4c7d-b268-2badc7d093ec'),
 ('53', '47', '5', '1', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Badnoise\",\"slug\":\"badnoise\",\"postDate\":null,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"13\":\"<p>The brief for this project was to create a music streaming service, which had Login\\/Logout features, two tiers of users, each of whom would have access to different features, a file upload facility, as well as the ability to add and remove artists, and songs.&nbsp;<\\/p><p>The process I&nbsp;went through to create Badnoise was relatively straightforward. Firstly, I&nbsp;created designs in Sketch, which helped me visualise the layout of the application, and all of its various features. After this, I&nbsp;created a responsive HTML and CSS&nbsp;site. I tested this along with all the relevant jQuery interactive features across all screen sizes I&nbsp;could, using the browser viewport, and other devices which had touchscreens.<\\/p><p>F<\\/p>\",\"29\":\"Badnoise is a music streaming platform developed for my Mobile Web Application module at Brunel.\",\"30\":[\"45\"],\"15\":\"<p>Mobile Web Application Project &&nbsp;Server-side Web Development<\\/p>\",\"17\":\"TBC\",\"18\":\"UI, UX, mySQL, HTML, CSS, jQuery, JSON, Ajax, PHP\",\"14\":\"Modules\",\"16\":\"Grade Received\",\"19\":\"Skills Required\",\"4\":\"Badnoise\",\"26\":\"#76fbf6\",\"27\":[\"25\"],\"31\":\"\",\"32\":\"\",\"33\":\"\",\"25\":[\"14\",\"43\",\"44\"],\"5\":\"A music streaming web application based around an SQL database.\",\"28\":\"A music streaming web application based around an SQL database.\"}}', '2016-06-27 10:55:25', '2016-06-27 10:55:25', '89552ffb-a391-4cba-a7a3-755cd66aba6c'),
 ('54', '47', '5', '1', 'en', '2', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Badnoise\",\"slug\":\"badnoise\",\"postDate\":null,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"13\":\"<p>The brief for this project was to create a music streaming service, which had Login\\/Logout features, two tiers of users, each of whom would have access to different features, a file upload facility, as well as the ability to add and remove artists, and songs.&nbsp;<\\/p>\\r\\n\\r\\n<p>The process I&nbsp;went through to create Badnoise was relatively straightforward. Firstly, I&nbsp;created designs in Sketch, which helped me visualise the layout of the application, and all of its various features. After this, I&nbsp;created a responsive HTML and CSS&nbsp;site. I tested this along with all the relevant jQuery interactive features across all screen sizes I&nbsp;could, using the browser viewport, and other devices which had touchscreens.<\\/p>\\r\\n\\r\\n<p>Finally came time to set up the SQL&nbsp;database and create the interaction between the application and the database. We were provided a database creation script, which only had to run on localhost. Using PHP&nbsp;scripts initiated by jQuery requests, I&nbsp;returned JSON&nbsp;arrays which were received and echoed to the browser.<\\/p>\",\"29\":\"Badnoise is a music streaming platform developed for my Mobile Web Application module at Brunel.\",\"30\":[\"45\"],\"15\":\"<p>Mobile Web Application Project &&nbsp;Server-side Web Development<\\/p>\",\"17\":\"TBC\",\"18\":\"UI, UX, mySQL, HTML, CSS, jQuery, JSON, Ajax, PHP\",\"14\":\"Modules\",\"16\":\"Grade Received\",\"19\":\"Skills Required\",\"4\":\"Badnoise\",\"26\":\"#76fbf6\",\"27\":[\"25\"],\"31\":[\"46\"],\"32\":[\"48\"],\"33\":[\"49\"],\"25\":[\"14\",\"43\",\"44\"],\"5\":\"A music streaming web application based around an SQL database.\",\"28\":\"A music streaming web application based around an SQL database.\"}}', '2016-06-27 11:02:21', '2016-06-27 11:02:21', '1eb9f885-9791-4cd0-a41e-762a1bd291b2'),
 ('55', '55', '5', '1', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Apply Ignorance\",\"slug\":\"apply-ignorance\",\"postDate\":null,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"13\":\"\",\"29\":\"\",\"30\":[\"51\"],\"15\":\"\",\"17\":\"\",\"18\":\"\",\"14\":\"\",\"16\":\"\",\"19\":\"\",\"4\":\"Apply Ignorance\",\"26\":\"#00b3ff\",\"27\":[\"26\"],\"31\":\"\",\"32\":\"\",\"33\":\"\",\"25\":[\"16\",\"34\",\"50\"],\"5\":\"Animated scrolling storytelling, based around an esoteric link.\",\"28\":\"Animated scrolling storytelling, based around an esoteric link.\"}}', '2016-06-27 11:25:16', '2016-06-27 11:25:16', 'e5a05231-3444-42da-8d4f-39a06ff802a8'),
 ('56', '55', '5', '1', 'en', '2', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Apply Ignorance\",\"slug\":\"apply-ignorance\",\"postDate\":null,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"13\":\"<p>This project was rather odd. Essentially we were given two random famous people from history, and asked to find a link between them. From this link, we would make an \'artefact\'. This artefact could be anything we could reasonably create ourselves, so long as it portrayed the link we had decided on.&nbsp;<\\/p><p>My two famous people were Miles Davis, the jazz trumpeter, and Robert Frank, an american photographer. Initially I&nbsp;found it hard to find links between these two men. They were both similar in minor aspects, but also vastly different in nearly every other aspects. Eventually after a lot of research, my links began to look suitably esoteric. I decided on three to present as part of the module, but had already envisioned the end goal, and the end link - titled&nbsp;<strong>Subjectivity of Creativity<\\/strong>.<\\/p><p>The main idea from this was that creativity is, at its heart, extremely dependent on its context and surroundings. If Einstein had been born into Dark Ages England for example, he probably would have been burned at the stake for witchcraft. With this in mind, I&nbsp;decided to use Adobe Muse to create a set of scrollable webpages, which would tell stories through moving elements. The stories themselves would centre around 3 great progressives and creatives; Barack Obama, Steve Jobs, and Einstein.<\\/p><p><a href=\\\"http:\\/\\/brunel.ac.uk\\/~dt14mmg\\/ignorance\\/\\\" target=\\\"_blank\\\">You can view this project and explore for yourself here.<\\/a><\\/p>\",\"29\":\"Scrollable, dynamic storytelling, exploring the possibilities great creatives and visionaries would have had open to them had they been born in another time.\",\"30\":[\"51\"],\"15\":\"<p>People Fusion<\\/p>\",\"17\":\"A\",\"18\":\"Research, Illustration, Adobe Muse\",\"14\":\"Module\",\"16\":\"Grade Achieved\",\"19\":\"Skills Required\",\"4\":\"Apply Ignorance\",\"26\":\"#00b3ff\",\"27\":[\"26\"],\"31\":[\"52\"],\"32\":[\"53\"],\"33\":[\"54\"],\"25\":[\"16\",\"34\",\"50\"],\"5\":\"Animated scrolling storytelling, based around an esoteric link.\",\"28\":\"Animated scrolling storytelling, based around an esoteric link.\"}}', '2016-06-27 11:45:19', '2016-06-27 11:45:19', '5681785f-a083-477f-8a95-8b42f161a261'),
 ('57', '55', '5', '1', 'en', '3', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Apply Ignorance\",\"slug\":\"apply-ignorance\",\"postDate\":1467027920,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This project was rather odd. Essentially we were given two random famous people from history, and asked to find a link between them. From this link, we would make an \'artefact\'. This artefact could be anything we could reasonably create ourselves, so long as it portrayed the link we had decided on.&nbsp;<\\/p><p>My two famous people were Miles Davis, the jazz trumpeter, and Robert Frank, an american photographer. Initially I&nbsp;found it hard to find links between these two men. They were both similar in minor aspects, but also vastly different in nearly every other aspects. Eventually after a lot of research, my links began to look suitably esoteric. I decided on three to present as part of the module, but had already envisioned the end goal, and the end link - titled&nbsp;<strong>Subjectivity of Creativity<\\/strong>.<\\/p><p>The main idea from this was that creativity is, at its heart, extremely dependent on its context and surroundings. If Einstein had been born into Dark Ages England for example, he probably would have been burned at the stake for witchcraft. With this in mind, I&nbsp;decided to use Adobe Muse to create a set of scrollable webpages, which would tell stories through moving elements. The stories themselves would centre around 3 great progressives and creatives; Barack Obama, Steve Jobs, and Einstein.<\\/p><p><a href=\\\"http:\\/\\/brunel.ac.uk\\/~dt14mmg\\/ignorance\\/\\\" target=\\\"_blank\\\">You can view this project and explore for yourself here.<\\/a><\\/p>\",\"29\":\"Scrollable, dynamic storytelling, exploring the possibilities great creatives and visionaries would have had open to them had they been born in another time.\",\"30\":[\"51\"],\"15\":\"<p>People Fusion<\\/p>\",\"17\":\"A\",\"18\":\"Research, Illustration, Adobe Muse\",\"14\":\"Module\",\"16\":\"Grade Achieved\",\"19\":\"Skills Required\",\"4\":\"Apply Ignorance\",\"26\":\"#00b3ff\",\"27\":[\"26\"],\"31\":[\"52\"],\"32\":[\"53\"],\"33\":[\"54\"],\"25\":[\"16\",\"34\",\"50\"],\"5\":\"Animated scrolling storytelling, based around an esoteric link.\",\"28\":\"Animated scrolling storytelling, based around an esoteric link.\"}}', '2016-06-27 11:45:21', '2016-06-27 11:45:21', '51665a43-ddd0-4311-acb5-32f06c4a0f3d'),
 ('58', '66', '5', '1', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Photography\",\"slug\":\"photography\",\"postDate\":1467029760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This will be short and sweet - all of my photos are not hosted here because I&nbsp;am cheap and don\'t want to pay to host trillions of images, each of which is huge.&nbsp;<\\/p>\\r\\n\\r\\n<p><a href=\\\"https:\\/\\/www.flickr.com\\/photos\\/126928783@N04\\/\\\" target=\\\"_blank\\\">You will find all of my best photographs here, at my flickr account - I&nbsp;hope you like them.<\\/a><\\/p>\\r\\n\\r\\n<p>Also, if you have any questions about any of them, or would like to see more; there is around 13,000 of them sitting in my Lightroom at the moment. Let me know. Below are three good\'uns.<\\/p>\",\"29\":\"Photos are cool to look at, so here are mine.\",\"30\":[\"62\"],\"15\":\"<p>Canon 5D Mk III<\\/p>\",\"17\":\"24-105mm L Zoom\",\"18\":\"Amsterdam\",\"14\":\"Personal Camera\",\"16\":\"Favourite Lens\",\"19\":\"Favourite Place\",\"4\":\"Photography\",\"26\":\"#000000\",\"27\":[\"27\"],\"31\":[\"63\"],\"32\":[\"64\"],\"33\":[\"65\"],\"25\":[\"58\",\"59\",\"60\"],\"5\":\"In my spare time I like to take photos - here are some.\",\"28\":\"In my spare time I like to take photos - here are some.\"}}', '2016-06-27 12:17:13', '2016-06-27 12:17:13', '689ec91f-b250-46c7-b60b-727cf3f0b39d'),
 ('59', '2', '1', '1', 'en', '12', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Portfolio - MG\",\"slug\":\"homepage\",\"postDate\":1466693187,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"I\\u2019m a digital product designer & student at brunel university. I make beautiful things that work.\",\"47\":\"#df006a\",\"53\":\"#00c3f2\",\"54\":\"#d5d5d5\",\"55\":\"#76fbf6\",\"56\":\"#00b3ff\",\"57\":\"#000000\",\"46\":[\"17\"],\"48\":[\"23\"],\"49\":[\"24\"],\"50\":[\"25\"],\"51\":[\"26\"],\"52\":[\"27\"],\"40\":\"app design\",\"41\":\"product development\",\"42\":\"branding\",\"43\":\"web app build\",\"44\":\"website build\",\"45\":\"portfolio\",\"34\":\"Cadenza\",\"35\":\"Ambio\",\"36\":\"Cosmos\",\"37\":\"Badnoise\",\"38\":\"Apply Ignorance\",\"39\":\"Photography\"}}', '2016-06-27 15:44:11', '2016-06-27 15:44:11', '2062a440-c9a5-4aa6-933e-75865e31d13b'),
 ('60', '47', '5', '1', 'en', '3', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Badnoise\",\"slug\":\"badnoise\",\"postDate\":1467025320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>The brief for this project was to create a music streaming service, which had Login\\/Logout features, two tiers of users, each of whom would have access to different features, a file upload facility, as well as the ability to add and remove artists, and songs.&nbsp;<\\/p>\\r\\n\\r\\n<p>The process I&nbsp;went through to create Badnoise was relatively straightforward. Firstly, I&nbsp;created designs in Sketch, which helped me visualise the layout of the application, and all of its various features. After this, I&nbsp;created a responsive HTML and CSS&nbsp;site. I tested this along with all the relevant jQuery interactive features across all screen sizes I&nbsp;could, using the browser viewport, and other devices which had touchscreens.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>Finally came time to set up the SQL&nbsp;database and create the interaction between the application and the database. We were provided a database creation script, which only had to run on localhost. Using PHP&nbsp;scripts initiated by jQuery requests, I&nbsp;returned JSON&nbsp;arrays which were received and echoed to the browser.<\\/p>\",\"29\":\"Badnoise is a music streaming platform developed for my Mobile Web Application module at Brunel.\",\"30\":[\"45\"],\"15\":\"<p>Mobile Web Application Project &&nbsp;Server-side Web Development<\\/p>\",\"17\":\"TBC\",\"18\":\"UI, UX, mySQL, HTML, CSS, jQuery, JSON, Ajax, PHP\",\"14\":\"Modules\",\"16\":\"Grade Received\",\"19\":\"Skills Required\",\"4\":\"Badnoise\",\"26\":\"#76fbf6\",\"27\":[\"25\"],\"31\":[\"46\"],\"32\":[\"48\"],\"33\":[\"49\"],\"25\":[\"14\",\"43\",\"44\"],\"5\":\"A music streaming web application based around an SQL database.\",\"28\":\"A music streaming web application based around an SQL database.\"}}', '2016-06-27 17:0