 ('61', '9', '5', '1', 'en', '12', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Cadenza\",\"slug\":\"cadenza\",\"postDate\":1466703240,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This was completed as an assignment for my Design for Mobile module at university. The brief was very open \\u2013 create an app for a smartphone. I have an iPhone so I decided to design for what I knew, and what I could test myself.<\\/p>\\r\\n\\r\\n<p>The idea of the app is now something I am pursuing in the real world \\u2013 I am starting to learn to code in Swift, and have acquired the social media accounts. I intend to develop the app, and market it myself over the coming year. What you see here was created and exported entirely from Sketch \\u2013 then entered into InVision to create the working prototype at the bottom of the page.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Put simply, the app helps musicians to acquire business, and people who need talented artists to find them. The app allows people to post jobs, and post pay details, or expenses. They also include the skills they require, and what level they need them to be. The musician has a profile which includes all of this information.<\\/p>\",\"29\":\"A job listing application for musicians to find work, and employers to find temporary or long term musical partners.\",\"30\":[\"71\"],\"15\":\"<p>Mobile Application Design<\\/p>\",\"17\":\"A\",\"18\":\"Sketch, Invision, UI, UX\",\"14\":\"Module\",\"16\":\"Grade Received\",\"19\":\"Skills Required \",\"4\":\"Cadenza\",\"26\":\"#df006a\",\"27\":[\"17\"],\"31\":[\"156\"],\"32\":[\"154\"],\"33\":[\"155\"],\"25\":[\"12\",\"13\",\"14\"],\"5\":\"An application and Invision protoype connecting musicians to their next gigs.\",\"28\":\"An application and Invision protoype connecting musicians to their next gigs.\"}}', '2016-06-28 09:31:58', '2016-06-28 09:31:58', 'e40b4937-8479-4975-a674-a43c8355d46d'),
