 ('63', '30', '5', '1', 'en', '5', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Ambio\",\"slug\":\"ambio\",\"postDate\":1466875980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>Ambient Intelligence (sometimes referred to as ubiquitous computing) is a technology which does not, currently, exist anywhere it a perfect form.&nbsp;It is not, therefore, a single piece of hardware, or software. It does not come in a box marked \\u2018ambient intelligence\\u2019 with instructions to simply plug in and connect to wifi. It is more esoteric than that. It pertains to an integration between users and technology.<br><\\/p>\\r\\n\\r\\n<p>Ambio is a product which couples an implantable chip, consisting of\\r\\na uniquely identifiable RFID tag, and small, transmitting biosensors\\r\\nwhich monitor vital signs of a user. This chip is coupled with the\\r\\nambio app, which uses this data to make the user\\u2019s smarthome\\r\\nenvironment ambiently intelligent.&nbsp;<\\/p>\\r\\n\\r\\n<p>The app communicates with&nbsp;the user\\u2019s house, car, and other appliances, including their online\\r\\naccounts proactively, reducing the need for a user constantly\\r\\ninteract with technology. The implantable RFID tag can also be used\\r\\nfor storing vital medical information, unlocking a house and car, and\\r\\ntracking and identifying a user within their smarthome.&nbsp;<\\/p>\",\"29\":\"Selecting Ambient Intelligence as my emerging technology, I had to research the technology, then create a new digital product, design, brand, and justify it in theory.\",\"30\":[\"29\"],\"15\":\"<p>EE2614 - Experimental Digital Futures<\\/p>\",\"17\":\"A-\",\"18\":\"Detailed Research and Citation, Sketch, UI, UX, Branding\",\"14\":\"Module\",\"16\":\"Grade\",\"19\":\"Skills Required\",\"4\":\"Ambio\",\"26\":\"#00c3f2\",\"27\":[\"23\"],\"31\":[\"153\"],\"32\":[\"35\"],\"33\":[\"33\"],\"25\":[\"12\",\"15\",\"34\"],\"5\":\"Exploiting a emerging digital technology to create a new digital product.\",\"28\":\"Exploiting a emerging digital technology to create a new digital product.\"}}', '2016-06-28 09:35:24', '2016-06-28 09:35:24', '49dbe1eb-52fe-4bff-8e2a-a901d2f5c955'),
