 ('74', '30', '5', '1', 'en', '9', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Ambio\",\"slug\":\"ambio\",\"postDate\":1466875980,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>Ambient Intelligence (sometimes referred to as ubiquitous computing) is a technology which does not, currently, exist anywhere it a perfect form.&nbsp;It is not, therefore, a single piece of hardware, or software. It does not come in a box marked \\u2018ambient intelligence\\u2019 with instructions to simply plug in and connect to wifi. It is more esoteric than that. It pertains to an integration between users and technology.<br><\\/p>\\r\\n\\r\\n<p>Ambio is a product which couples an implantable chip, consisting of\\r\\na uniquely identifiable RFID tag, and small, transmitting biosensors\\r\\nwhich monitor vital signs of a user. This chip is coupled with the\\r\\nambio app, which uses this data to make the user\\u2019s smarthome\\r\\nenvironment ambiently intelligent.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>The app communicates with&nbsp;the user\\u2019s house, car, and other appliances, including their online\\r\\naccounts proactively, reducing the need for a user constantly\\r\\ninteract with technology. The implantable RFID tag can also be used\\r\\nfor storing vital medical information, unlocking a house and car, and\\r\\ntracking and identifying a user within their smarthome.&nbsp;<\\/p>\",\"29\":\"Selecting Ambient Intelligence as my emerging technology, I had to research the technology, then create a new digital product, design, brand, and justify it in theory.\",\"30\":[\"171\"],\"15\":\"<p>EE2614 - Experimental Digital Futures<\\/p>\",\"17\":\"A-\",\"18\":\"Detailed Research and Citation, Sketch, UI, UX, Branding\",\"14\":\"Module\",\"16\":\"Grade\",\"19\":\"Skills Required\",\"4\":\"Ambio\",\"26\":\"#00c3f2\",\"27\":[\"23\"],\"31\":[\"172\"],\"32\":[\"35\"],\"33\":[\"173\"],\"25\":[\"12\",\"15\",\"34\"],\"5\":\"Exploiting a emerging digital technology to create a new digital product.\",\"28\":\"Exploiting a emerging digital technology to create a new digital product.\"}}', '2016-06-28 11:39:02', '2016-06-28 11:39:02', '05f522f0-2a89-447f-836e-4635987f86dc'),
 ('75', '38', '5', '1', 'en', '6', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Cosmos\",\"slug\":\"cosmos\",\"postDate\":1466944500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>Cosmos brand mission is to provide quality fuel with personality.\\r\\nWhether the fuel is electricity, hydrogen, or good old fashioned\\r\\npetrol, you\\u2019ll be part of the Cosmos experience.<\\/p>\\r\\n\\r\\n<p>Cosmos is bringing the future of fuel delivery, both in what we\\r\\nprovide, and how we do it - we stretch what is possible. We value\\r\\nout of this world service above all else, and people are what make us\\r\\ngreat. We are the only fuel company to offer a personal fuel delivery\\r\\nservice, and to make you feel at home while we do it .<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p><strong>A&nbsp;Cosmos Experience<\\/strong><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Bong. Low Fuel. You use handsfree to get Siri to find you the nearest Cosmos, she does this using the app on your phone, and sets the\\r\\nnavigiation accordingly. You pull onto the forecourt - currently all of the manned pumps are taken, with motorists in their car relaxing with a\\r\\nfree coffee whilst their fuel is pumped. You drive to the self service pump. As you drive up, the ANPR cameras recognise your car - \\u2018Welcome\\r\\nChristopher\\u2019 is displayed.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>As you always fill up with Petrol, this option is preselected in the one pump system, but you confirm the choice,\\r\\nand start to&nbsp;fill up. The meter ticks over onto \\u00a325, and you touch Finish and Pay. 3 options are displayed; Card, Cash, and Cosmos Pay. You\\r\\nchoose the latter, and the payment process is confirmed. The pump has communicated with your account with Cosmos to get the payment,\\r\\nand has credited you with the appropriate loyalty coupons. Next time you come you\\u2019ll get a free coffee and 5p o  per litre - Bonus.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>\\r\\nAs you get into your car and drive away, a push notification pops up on your phone \\u201cThank you for refuelling with Cosmos, see you in the\\r\\nfuture...\\u201d.&nbsp;<\\/p>\",\"29\":\"As part of my second year Design Practice module, ELSE set an industry brief to design and brand a new premium fuel retailer.\",\"30\":\"\",\"15\":\"<p>Design Practice<\\/p>\",\"17\":\"B+\",\"18\":\"Branding, Sketch Design, InDesign Documentation, Presentation\",\"14\":\"Module\",\"16\":\"Grade Received \",\"19\":\"Skills Required\",\"4\":\"Cosmos\",\"26\":\"#d4d4d4\",\"27\":[\"24\"],\"31\":\"\",\"32\":\"\",\"33\":\"\",\"25\":[\"13\",\"15\",\"36\"],\"5\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\",\"28\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\"}}', '2016-06-28 11:42:08', '2016-06-28 11:42:08', '3d682e4e-e0e3-40c5-aafa-425629a6acbc'),
