  per litre - Bonus.&nbsp;<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>\\r\\nAs you get into your car and drive away, a push notification pops up on your phone \\u201cThank you for refuelling with Cosmos, see you in the\\r\\nfuture...\\u201d.&nbsp;<\\/p>\",\"29\":\"As part of my second year Design Practice module, ELSE set an industry brief to design and brand a new premium fuel retailer.\",\"30\":[\"174\"],\"15\":\"<p>Design Practice<\\/p>\",\"17\":\"B+\",\"18\":\"Branding, Sketch Design, InDesign Documentation, Presentation\",\"14\":\"Module\",\"16\":\"Grade Received \",\"19\":\"Skills Required\",\"4\":\"Cosmos\",\"26\":\"#d4d4d4\",\"27\":[\"24\"],\"31\":[\"176\"],\"32\":[\"177\"],\"33\":[\"175\"],\"25\":[\"13\",\"15\",\"36\"],\"5\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\",\"28\":\"Branding exercise for a new, premium fuel retailer, set as a challenge by the agency ELSE.\"}}', '2016-06-28 11:45:33', '2016-06-28 11:45:33', '83c7405c-864f-4cca-aea3-96f31dae75fb'),
 ('77', '47', '5', '1', 'en', '4', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Badnoise\",\"slug\":\"badnoise\",\"postDate\":1467025320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>The brief for this project was to create a music streaming service, which had Login\\/Logout features, two tiers of users, each of whom would have access to different features, a file upload facility, as well as the ability to add and remove artists, and songs.&nbsp;<\\/p>\\r\\n\\r\\n<p>The process I&nbsp;went through to create Badnoise was relatively straightforward. Firstly, I&nbsp;created designs in Sketch, which helped me visualise the layout of the application, and all of its various features. After this, I&nbsp;created a responsive HTML and CSS&nbsp;site. I tested this along with all the relevant jQuery interactive features across all screen sizes I&nbsp;could, using the browser viewport, and other devices which had touchscreens.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Finally came time to set up the SQL&nbsp;database and create the interaction between the application and the database. We were provided a database creation script, which only had to run on localhost. Using PHP&nbsp;scripts initiated by jQuery requests, I&nbsp;returned JSON&nbsp;arrays which were received and echoed to the browser.<\\/p>\",\"29\":\"Badnoise is a music streaming platform developed for my Mobile Web Application module at Brunel.\",\"30\":[\"179\"],\"15\":\"<p>Mobile Web Application Project &&nbsp;Server-side Web Development<\\/p>\",\"17\":\"TBC\",\"18\":\"UI, UX, mySQL, HTML, CSS, jQuery, JSON, Ajax, PHP\",\"14\":\"Modules\",\"16\":\"Grade Received\",\"19\":\"Skills Required\",\"4\":\"Badnoise\",\"26\":\"#76fbf6\",\"27\":[\"25\"],\"31\":\"\",\"32\":\"\",\"33\":\"\",\"25\":[\"14\",\"43\",\"44\"],\"5\":\"A music streaming web application based around an SQL database.\",\"28\":\"A music streaming web application based around an SQL database.\"}}', '2016-06-28 11:50:11', '2016-06-28 11:50:11', '205e55f6-9e2b-4814-9bd0-0dde502fc1d6'),
