base.\"}}', '2016-06-28 11:53:22', '2016-06-28 11:53:22', '30c9ed7e-3eef-49e4-afcd-3da7f6fbb59d'),
 ('79', '47', '5', '1', 'en', '6', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Badnoise\",\"slug\":\"badnoise\",\"postDate\":1467025320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>The brief for this project was to create a music streaming service, which had Login\\/Logout features, two tiers of users, each of whom would have access to different features, a file upload facility, as well as the ability to add and remove artists, and songs.&nbsp;<\\/p>\\r\\n\\r\\n<p>The process I&nbsp;went through to create Badnoise was relatively straightforward. Firstly, I&nbsp;created designs in Sketch, which helped me visualise the layout of the application, and all of its various features. After this, I&nbsp;created a responsive HTML and CSS&nbsp;site. I tested this along with all the relevant jQuery interactive features across all screen sizes I&nbsp;could, using the browser viewport, and other devices which had touchscreens.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Finally came time to set up the SQL&nbsp;database and create the interaction between the application and the database. We were provided a database creation script, which only had to run on localhost. Using PHP&nbsp;scripts initiated by jQuery requests, I&nbsp;returned JSON&nbsp;arrays which were received and echoed to the browser.<\\/p>\",\"29\":\"Badnoise is a music streaming platform developed for my Mobile Web Application module at Brunel.\",\"30\":[\"184\"],\"15\":\"<p>Mobile Web Application Project &&nbsp;Server-side Web Development<\\/p>\",\"17\":\"TBC\",\"18\":\"UI, UX, mySQL, HTML, CSS, jQuery, JSON, Ajax, PHP\",\"14\":\"Modules\",\"16\":\"Grade Received\",\"19\":\"Skills Required\",\"4\":\"Badnoise\",\"26\":\"#76fbf6\",\"27\":[\"25\"],\"31\":[\"181\"],\"32\":[\"183\"],\"33\":[\"182\"],\"25\":[\"14\",\"43\",\"44\"],\"5\":\"A music streaming web application based around an SQL database.\",\"28\":\"A music streaming web application based around an SQL database.\"}}', '2016-06-28 11:56:44', '2016-06-28 11:56:44', 'bf4f50fe-7d39-41c9-afd0-cf9422468e9d'),
 ('80', '55', '5', '1', 'en', '4', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Apply Ignorance\",\"slug\":\"apply-ignorance\",\"postDate\":1467027900,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This project was rather odd. Essentially we were given two random famous people from history, and asked to find a link between them. From this link, we would make an \'artefact\'. This artefact could be anything we could reasonably create ourselves, so long as it portrayed the link we had decided on.&nbsp;<\\/p>\\r\\n\\r\\n<p>My two famous people were Miles Davis, the jazz trumpeter, and Robert Frank, an american photographer. Initially I&nbsp;found it hard to find links between these two men. They were both similar in minor aspects, but also vastly different in nearly every other aspects. Eventually after a lot of research, my links began to look suitably esoteric. I decided on three to present as part of the module, but had already envisioned the end goal, and the end link - titled&nbsp;<strong>Subjectivity of Creativity<\\/strong>.<\\/p>\\r\\n\\r\\n<p>The main idea from this was that creativity is, at its heart, extremely dependent on its context and surroundings. If Einstein had been born into Dark Ages England for example, he probably would have been burned at the stake for witchcraft. With this in mind, I&nbsp;decided to use Adobe Muse to create a set of scrollable webpages, which would tell stories through moving elements. The stories themselves would centre around 3 great progressives and creatives; Barack Obama, Steve Jobs, and Einstein.<\\/p>\\r\\n\\r\\n<p><a href=\\\"http:\\/\\/brunel.ac.uk\\/~dt14mmg\\/ignorance\\/\\\" target=\\\"_blank\\\">You can view this project and explore for yourself here.<\\/a><\\/p>\",\"29\":\"Scrollable, dynamic storytelling, exploring the possibilities great creatives and visionaries would have had open to them had they been born in another time.\",\"30\":[\"185\"],\"15\":\"<p>People Fusion<\\/p>\",\"17\":\"A\",\"18\":\"Research, Illustration, Adobe Muse\",\"14\":\"Module\",\"16\":\"Grade Achieved\",\"19\":\"Skills Required\",\"4\":\"Apply Ignorance\",\"26\":\"#00b3ff\",\"27\":[\"26\"],\"31\":[\"186\"],\"32\":[\"187\"],\"33\":[\"188\"],\"25\":[\"16\",\"34\",\"50\"],\"5\":\"Animated scrolling storytelling, based around an esoteric link.\",\"28\":\"Animated scrolling storytelling, based around an esoteric link.\"}}', '2016-06-28 12:05:54', '2016-06-28 12:05:54', '4f973283-3de8-4bdb-80dc-aa0493d25583'),
