 ('83', '66', '5', '1', 'en', '2', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Photography\",\"slug\":\"photography\",\"postDate\":1467029760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This will be short and sweet - all of my photos are not hosted here because I&nbsp;am cheap and don\'t want to pay to host trillions of images, each of which is huge.&nbsp;<\\/p>\\r\\n\\r\\n<p><a href=\\\"https:\\/\\/www.flickr.com\\/photos\\/126928783@N04\\/\\\" target=\\\"_blank\\\">You will find all of my best photographs here, at my flickr account - I&nbsp;hope you like them.<\\/a><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>Also, if you have any questions about any of them, or would like to see more; there is around 13,000 of them sitting in my Lightroom at the moment. Let me know. Below are three good\'uns.<\\/p>\",\"29\":\"Photos are cool to look at, so here are mine.\",\"30\":\"\",\"15\":\"<p>Canon 5D Mk III<\\/p>\",\"17\":\"24-105mm L Zoom\",\"18\":\"Amsterdam\",\"14\":\"Personal Camera\",\"16\":\"Favourite Lens\",\"19\":\"Favourite Place\",\"4\":\"Photography\",\"26\":\"#000000\",\"27\":[\"109\"],\"31\":\"\",\"32\":\"\",\"33\":\"\",\"25\":[\"58\",\"59\",\"60\"],\"5\":\"In my spare time I like to take photos - here are some.\",\"28\":\"In my spare time I like to take photos - here are some.\"}}', '2016-06-28 12:11:51', '2016-06-28 12:11:51', '6c58103b-3acf-4841-b5f1-67f46305b52d'),
 ('84', '66', '5', '1', 'en', '3', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Photography\",\"slug\":\"photography\",\"postDate\":1467029760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This will be short and sweet - all of my photos are not hosted here because I&nbsp;am cheap and don\'t want to pay to host trillions of images, each of which is huge.&nbsp;<\\/p>\\r\\n\\r\\n<p><a href=\\\"https:\\/\\/www.flickr.com\\/photos\\/126928783@N04\\/\\\" target=\\\"_blank\\\">You will find all of my best photographs here, at my flickr account - I&nbsp;hope you like them.<\\/a><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Also, if you have any questions about any of them, or would like to see more; there is around 13,000 of them sitting in my Lightroom at the moment. Let me know. Below are three good\'uns.<\\/p>\",\"29\":\"Photos are cool to look at, so here are mine.\",\"30\":[\"194\"],\"15\":\"<p>Canon 5D Mk III<\\/p>\",\"17\":\"24-105mm L Zoom\",\"18\":\"Amsterdam\",\"14\":\"Personal Camera\",\"16\":\"Favourite Lens\",\"19\":\"Favourite Place\",\"4\":\"Photography\",\"26\":\"#000000\",\"27\":[\"109\"],\"31\":[\"191\"],\"32\":[\"192\"],\"33\":[\"193\"],\"25\":[\"58\",\"59\",\"60\"],\"5\":\"In my spare time I like to take photos - here are some.\",\"28\":\"In my spare time I like to take photos - here are some.\"}}', '2016-06-28 12:15:30', '2016-06-28 12:15:30', 'ab2e454a-3e2b-4199-80dd-ac632477b74a'),
 ('85', '66', '5', '1', 'en', '4', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Photography\",\"slug\":\"photography\",\"postDate\":1467029760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This will be short and sweet - all of my photos are not hosted here because I&nbsp;am cheap and don\'t want to pay to host trillions of images, each of which is huge.&nbsp;<\\/p>\\r\\n\\r\\n<p><a href=\\\"https:\\/\\/www.flickr.com\\/photos\\/126928783@N04\\/\\\" target=\\\"_blank\\\">You will find all of my best photographs here, at my flickr account - I&nbsp;hope you like them.<\\/a><\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Also, if you have any questions about any of them, or would like to see more; there is around 13,000 of them sitting in my Lightroom at the moment. Let me know. Below are three good\'uns.<\\/p>\",\"29\":\"Photos are cool to look at, so here are mine.\",\"30\":[\"195\"],\"15\":\"<p>Canon 5D Mk III<\\/p>\",\"17\":\"24-105mm L Zoom\",\"18\":\"Amsterdam\",\"14\":\"Personal Camera\",\"16\":\"Favourite Lens\",\"19\":\"Favourite Place\",\"4\":\"Photography\",\"26\":\"#000000\",\"27\":[\"109\"],\"31\":[\"191\"],\"32\":[\"192\"],\"33\":[\"193\"],\"25\":[\"58\",\"59\",\"60\"],\"5\":\"In my spare time I like to take photos - here are some.\",\"28\":\"In my spare time I like to take photos - here are some.\"}}', '2016-06-28 12:17:31', '2016-06-28 12:17:31', 'deb5800f-e103-444b-a861-e617645e11a0'),
 ('86', '9', '5', '1', 'en', '19', '', '{\"typeId\":\"5\",\"authorId\":\"1\",\"title\":\"Cadenza\",\"slug\":\"cadenza\",\"postDate\":1466703240,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"13\":\"<p>This was completed as an assignment for my Design for Mobile module at university. The brief was very open \\u2013 create an app for a smartphone. I have an iPhone so I decided to design for what I knew, and what I could test myself.<\\/p>\\r\\n\\r\\n<p>The idea of the app is now something I am pursuing in the real world \\u2013 I am starting to learn to code in Swift, and have acquired the social media accounts. I intend to develop the app, and market it myself over the coming year. What you see here was created and exported entirely from Sketch \\u2013 then entered into InVision to create the working prototype at the bottom of the page.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<p>Put simply, the app helps musicians to acquire business, and people who need talented artists to find them. The app allows people to post jobs, and post pay details, or expenses. They also include the skills they require, and what level they need them to be. The musician has a profile which includes all of this information.<\\/p><p><a href=\\\"https:\\/\\/invis.io\\/UY4UBYP32\\\" target=\\\"_blank\\\">To play with the prototype of the app, go here.<\\/a><\\/p>\",\"29\":\"A job listing application for musicians to find work, and employers to find temporary or long term musical partners.\",\"30\":[\"167\"],\"15\":\"<p>Mobile Application Design<\\/p>\",\"17\":\"A\",\"18\":\"Sketch, Invision, UI, UX\",\"14\":\"Module\",\"16\":\"Grade Received\",\"19\":\"Skills Required \",\"4\":\"Cadenza\",\"26\":\"#df006a\",\"27\":[\"166\"],\"31\":[\"170\"],\"32\":[\"169\"],\"33\":[\"168\"],\"25\":[\"12\",\"13\",\"14\"],\"5\":\"An application and Invision protoype connecting musicians to their next gigs.\",\"28\":\"An application and Invision protoype connecting musicians to their next gigs.\"}}', '2016-06-29 11:13:54', '2016-06-29 11:13:54', 'eae43828-5400-4775-9084-378b6cf37c99'),
 ('87', '2', '1', '1', 'en', '15', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Portfolio - MG\",\"slug\":\"homepage\",\"postDate\":1466693187,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"I\\u2019m a digital product designer & student at brunel university. I make beautiful things that work.\",\"47\":\"#df006a\",\"53\":\"#00c3f2\",\"54\":\"#d5d5d5\",\"55\":\"#76fbf6\",\"56\":\"#000000\",\"57\":\"#00b3ff\",\"46\":[\"166\"],\"48\":[\"105\"],\"49\":[\"106\"],\"50\":[\"25\"],\"51\":[\"109\"],\"52\":[\"108\"],\"40\":\"app design\",\"41\":\"product development\",\"42\":\"branding\",\"43\":\"web app build\",\"44\":\"my portfolio\",\"45\":\"website build\",\"34\":\"Cadenza\",\"35\":\"Ambio\",\"36\":\"Cosmos\",\"37\":\"Badnoise\",\"38\":\"Photography\",\"39\":\"Apply Ignorance\"}}', '2016-06-29 11:21:47', '2016-06-29 11:21:47', '5d2f4b2c-df9a-4e8d-a818-59b38c7a25f7');
