INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES
 ('30', 'field', '28', 'en', ' exploiting a emerging digital technology to create a new digital product '),
 ('30', 'field', '29', 'en', ' selecting ambient intelligence as my emerging technology i had to research the technology then create a new digital product design brand and justify it in theory '),
 ('30', 'field', '14', 'en', ' module '),
 ('30', 'field', '15', 'en', ' ee2614 experimental digital futures '),
 ('30', 'field', '16', 'en', ' grade '),
 ('30', 'field', '17', 'en', ' a '),
 ('30', 'field', '19', 'en', ' skills required '),
 ('30', 'field', '18', 'en', ' detailed research and citation sketch ui ux branding '),
 ('30', 'field', '13', 'en', ' ambient intelligence sometimes referred to as ubiquitous computing is a technology which does not currently exist anywhere it a perfect form  it is not therefore a single piece of hardware or software it does not come in a box marked ambient intelligence with instructions to simply plug in and connect to wifi it is more esoteric than that it pertains to an integration between users and technology ambio is a product which couples an implantable chip consisting of a uniquely identifiable rfid tag and small transmitting biosensors which monitor vital signs of a user this chip is coupled with the ambio app which uses this data to make the user s smarthome environment ambiently intelligent   the app communicates with the user s house car and other appliances including their online accounts proactively reducing the need for a user constantly interact with technology the implantable rfid tag can also be used for storing vital medical information unlocking a house and car and tracking and identifying a user within their smarthome   '),
 ('30', 'field', '31', 'en', ' smartmockups copy '),
 ('30', 'field', '32', 'en', ' implant xray '),
 ('30', 'field', '33', 'en', ' smartmockups copy 3 '),
 ('38', 'slug', '0', 'en', ' cosmos '),
 ('38', 'title', '0', 'en', ' cosmos '),
 ('38', 'field', '4', 'en', ' cosmos '),
 ('38', 'field', '5', 'en', ' branding exercise for a new premium fuel retailer set as a challenge by the agency else '),
 ('38', 'field', '26', 'en', ' d4d4d4 '),
 ('38', 'field', '27', 'en', ' project3 '),
 ('38', 'field', '25', 'en', ' invision prototyping branding indesign documentation '),
 ('38', 'field', '30', 'en', ' cosmos 1x '),
 ('38', 'field', '28', 'en', ' branding exercise for a new premium fuel retailer set as a challenge by the agency else '),
 ('38', 'field', '29', 'en', ' as part of my second year design practice module else set an industry brief to design and brand a new premium fuel retailer '),
 ('38', 'field', '14', 'en', ' module '),
 ('38', 'field', '15', 'en', ' design practice '),
 ('38', 'field', '16', 'en', ' grade received '),
 ('38', 'field', '17', 'en', ' b '),
 ('38', 'field', '19', 'en', ' skills required '),
 ('38', 'field', '18', 'en', ' branding sketch design indesign documentation presentation '),
 ('38', 'field', '13', 'en', ' cosmos brand mission is to provide quality fuel with personality whether the fuel is electricity hydrogen or good old fashioned petrol you ll be part of the cosmos experience cosmos is bringing the future of fuel delivery both in what we provide and how we do it we stretch what is possible we value out of this world service above all else and people are what make us great we are the only fuel company to offer a personal fuel delivery service and to make you feel at home while we do it a cosmos experience bong low fuel you use handsfree to get siri to find you the nearest cosmos she does this using the app on your phone and sets the navigiation accordingly you pull onto the forecourt currently all of the manned pumps are taken with motorists in their car relaxing with a free coffee whilst their fuel is pumped you drive to the self service pump as you drive up the anpr cameras recognise your car welcome christopher is displayed   as you always fill up with petrol this option is preselected in the one pump system but you confirm the choice and start to fill up the meter ticks over onto 25 and you touch finish and pay 3 options are displayed card cash and cosmos pay you choose the latter and the payment process is confirmed the pump has communicated with your account with cosmos to get the payment and has credited you with the appropriate loyalty coupons next time you come you ll get a free coffee and 5p o per litre bonus   as you get into your car and drive away a push notification pops up on your phone thank you for refuelling with cosmos see you in the future   '),
 ('38', 'field', '31', 'en', ' station mockup '),
 ('38', 'field', '32', 'en', ' pump bg '),
 ('38', 'field', '33', 'en', ' cosmos identity '),
 ('47', 'slug', '0', 'en', ' badnoise '),
 ('47', 'title', '0', 'en', ' badnoise '),
 ('47', 'field', '4', 'en', ' badnoise '),
 ('47', 'field', '5', 'en', ' a music streaming web application based around an sql database '),
 ('47', 'field', '26', 'en', ' 76fbf6 '),
 ('47', 'field', '27', 'en', ' project4 '),
 ('47', 'field', '25', 'en', ' ui ux design responsive web design sql databases '),
 ('47', 'field', '30', 'en', ' badnoise 1x '),
 ('47', 'field', '28', 'en', ' a music streaming web application based around an sql database '),
 ('47', 'field', '29', 'en', ' badnoise is a music streaming platform developed for my mobile web application module at brunel '),
 ('47', 'field', '14', 'en', ' modules '),
 ('47', 'field', '15', 'en', ' mobile web application project  server side web development '),
 ('47', 'field', '16', 'en', ' grade received '),
 ('47', 'field', '17', 'en', ' tbc '),
 ('47', 'field', '19', 'en', ' skills required '),
 ('47', 'field', '18', 'en', ' ui ux mysql html css jquery json ajax php '),
 ('47', 'field', '13', 'en', ' the brief for this project was to create a music streaming service which had login logout features two tiers of users each of whom would have access to different features a file upload facility as well as the ability to add and remove artists and songs   the process i went through to create badnoise was relatively straightforward firstly i created designs in sketch which helped me visualise the layout of the application and all of its various features after this i created a responsive html and css site i tested this along with all the relevant jquery interactive features across all screen sizes i could using the browser viewport and other devices which had touchscreens finally came time to set up the sql database and create the interaction between the application and the database we were provided a database creation script which only had to run on localhost using php scripts initiated by jquery requests i returned json arrays which were received and echoed to the browser '),
 ('47', 'field', '31', 'en', ' badnoise1 '),
 ('47', 'field', '32', 'en', ' smartmockups 3 160627 115730 '),
