 ('55', 'field', '5', 'en', ' animated scrolling storytelling based around an esoteric link '),
 ('55', 'field', '26', 'en', ' 00b3ff '),
 ('55', 'field', '27', 'en', ' project5 '),
 ('55', 'field', '25', 'en', ' illustration research and development adobe muse '),
 ('55', 'field', '30', 'en', ' applyignorance 1x '),
 ('55', 'field', '28', 'en', ' animated scrolling storytelling based around an esoteric link '),
 ('55', 'field', '29', 'en', ' scrollable dynamic storytelling exploring the possibilities great creatives and visionaries would have had open to them had they been born in another time '),
 ('55', 'field', '14', 'en', ' module '),
 ('55', 'field', '15', 'en', ' people fusion '),
 ('55', 'field', '16', 'en', ' grade achieved '),
 ('55', 'field', '17', 'en', ' a '),
 ('55', 'field', '19', 'en', ' skills required '),
 ('55', 'field', '18', 'en', ' research illustration adobe muse '),
 ('55', 'field', '13', 'en', ' this project was rather odd essentially we were given two random famous people from history and asked to find a link between them from this link we would make an artefact this artefact could be anything we could reasonably create ourselves so long as it portrayed the link we had decided on   my two famous people were miles davis the jazz trumpeter and robert frank an american photographer initially i found it hard to find links between these two men they were both similar in minor aspects but also vastly different in nearly every other aspects eventually after a lot of research my links began to look suitably esoteric i decided on three to present as part of the module but had already envisioned the end goal and the end link titled subjectivity of creativity the main idea from this was that creativity is at its heart extremely dependent on its context and surroundings if einstein had been born into dark ages england for example he probably would have been burned at the stake for witchcraft with this in mind i decided to use adobe muse to create a set of scrollable webpages which would tell stories through moving elements the stories themselves would centre around 3 great progressives and creatives barack obama steve jobs and einstein you can view this project and explore for yourself here '),
